1.body:
The starting point of reading a parquet file is reading its metadata (at the end of the file). To do so, we offer two functions for sync and async: Sync parquet2::read::read_metadata for sync reads: use std::env; let args: Vec<String> = env::args().collect(); let path = &args[1]; use parquet2::read::read_metadata; let mut reader = std::fs::File::open(path)?; let metadata = read_metadata(&mut reader)?; println!("{:#?}", metadata); Async and parquet2::read::read_metadata_async, for async reads (using tokio::fs as example): use async_compat::Compat;
use parquet2::{error::Result, read::read_metadata_async};
use tokio::fs; #[tokio::main]
async fn main() -> Result<()> { let mut reader = Compat::new(fs::File::open("path.parquet").await?); let metadata = read_metadata_async(&mut reader).await?; // metadata println!("{:#?}", metadata); Ok(())
} In both cases, metadata: FileMetaData is the file's metadata.

2.body:
At this point, it is important to give a small introduction to the format itself. The metadata does not contain any data. Instead, the metadata contains the necessary information to read, decompress, decode and deserialize data. Generally: a file has a schema with columns and data data in the file is divided in row groups each row group contains column chunks each column chunk contains pages each page contains multiple values each of the entities above has associated metadata. Except for the pages, all this metadata is already available in the FileMetaData. Here we will focus on a single column to show how we can read it. We access the metadata of a column chunk via let row_group = 0; let column = 0; let column_metadata = metadata.row_groups[row_group].column(column); From this, we can produce an iterator of compressed pages (sync), parquet2::read::get_page_iterator or a stream (async) of compressed pages, parquet2::read::get_page_stream: use parquet2::read::get_page_iterator; let pages = get_page_iterator(column_metadata, &mut reader, None, vec![])?; in both cases, they yield individual CompressedDataPages. Note that these pages do hold values and own potentially large chunks of (compressed) memory. At this point, we are missing 3 steps: decompress, decode and deserialize. Decompression is done via decompress: let mut decompress_buffer = vec![]; for maybe_page in pages { let page = maybe_page?; let page = parquet2::read::decompress(page, &mut decompress_buffer)?; let _array = deserialize(&page, column_metadata.descriptor()); } Decoding and deserialization is usually done in the same step, as follows: use parquet2::encoding::Encoding;
use parquet2::metadata::ColumnDescriptor;
use parquet2::page::{split_buffer, DataPage};
use parquet2::schema::types::ParquetType; fn deserialize(page: &DataPage, descriptor: &ColumnDescriptor) { let (_rep_levels, _def_levels, _values_buffer) = split_buffer(page, descriptor); if let ParquetType::PrimitiveType { physical_type, converted_type, logical_type, .. } = descriptor.type_() { // map the types to your physical typing system (e.g. this usually adds // casting, tz conversions, int96 to timestamp) } else { // column chunks are always primitive types unreachable!() } // finally, decode and deserialize. match (&page.encoding(), page.dictionary_page()) { (Encoding::PlainDictionary | Encoding::RleDictionary, Some(_dict_page)) => { // plain encoded page with a dictionary // _dict_page can be downcasted based on the descriptor's physical type todo!() } (Encoding::Plain, None) => { // plain encoded page todo!() } _ => todo!(), }
} the details of the todo! are highly specific to the target in-memory format to use. Thus, here we only describe how to decompose the page buffer in its individual components and what you need to worry about. For example, reading to Apache Arrow often does not require decoding the definition levels, as they have the same representation as in Arrow, but do require deserialization of some values, as e.g. arrow supports unsigned integers while parquet only accepts (potentially encoded) i32 and i64 integers. Refer to the integration tests's implementation for deserialization to a simple in-memory format, and arrow2 for an implementation to the Apache Arrow format.
